import { createRoot } from "react-dom/client";
import { Route, Routes, BrowserRouter } from "react-router-dom";
import Home from "./pages/home";
import Collection from "./pages/collection";
import CollectionX from "./pages/collectionx";
import "./styles.css";

const root = createRoot(document.getElementById("root"));

root.render(
  <BrowserRouter>
    <Routes>
      <Route path="/" element={<Home />} />
      <Route path="/men" element={<Collection category="Men's" />} />
      <Route path="/women" element={<Collection category="Women's" />} />
      <Route
        path="/collection/men"
        element={<CollectionX category="Men's" />}
      />
      <Route
        path="/collection/women"
        element={<CollectionX category="Women's" />}
      />
    </Routes>
  </BrowserRouter>,
);
